	constructor(props){
		super(props);
		this.state = {date: new Date()};
	}
	render(){
		return (
		<div class="row">
		  <div class="column"> props.currentVersion</div>
		  <div class="column">props.currentVersion</div>
		  <div class="column">props.currentVersion</div>
		  <div class="column">props.currentVersion</div>
		  <div class="column">{this.state.date.toLocaleTimeString()}</div>
		</div>);
		}
}


ReactDOM.render(<Statement />, document.getElementById('root'));
